  null,\n\t\"notes\": \"LRS2008 is a Linear Referencing System layer that includes
  interstate, U.S., state (VT), and other transportation routes logged by the Vermont
  Agency of Transportation. The routes in this layer represent the ETE route system,
  where ETE stands for End-to-End-Based route system, meaning that routes increment
  from start to finish within the state. The routes represent the full routes from
  begining to end with no breaks for towns. The lines and attributes were extracted
  from TransRoad_RDS (7/2008 version of RDSMALL - 2008 HMS update) and calibrated
  to the route logs points (7/2008 version of RTLOGPTS - 2008 HMS update).\",\n\t\"owner_org\":
